import React, { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./Login";
import NoticeList from "./NoticeList";
import NoticeBoard from "./NoticeBoard";   // ‚úÖ Ï∂îÍ∞Ä
import CalendarView from "./CalendarView";
import ProtectedRoute from "./ProtectedRoute";

function App() {
  const [logged, setLogged] = useState(!!localStorage.getItem("token"));
  const token = localStorage.getItem("token");

  return (
    <BrowserRouter>
      <Routes>
        {/* Î°úÍ∑∏Ïù∏ ÌôîÎ©¥ */}
        <Route
          path="/"
          element={
            <Login
              onLogin={() => {
                setLogged(true);
                // üöÄ Î°úÍ∑∏Ïù∏ ÏÑ±Í≥µ ÌõÑ Í≥µÏßÄÏÇ¨Ìï≠ÏúºÎ°ú Ïù¥Îèô
                window.history.pushState({}, "", "/notices");
              }}
            />
          }
        />

        {/* Í≥µÏßÄÏÇ¨Ìï≠ Îì±Î°ù/Í≤ÄÏÉâ */}
        <Route
          path="/notices"
          element={
            <ProtectedRoute>
              <NoticeList token={token} />
            </ProtectedRoute>
          }
        />

        {/* Í≥µÏßÄÏÇ¨Ìï≠ Ï†ÑÏ≤¥ Î™©Î°ù */}
        <Route
          path="/notice-board"
          element={
            <ProtectedRoute>
              <NoticeBoard token={token} />
            </ProtectedRoute>
          }
        />

        {/* Ï∫òÎ¶∞Îçî */}
        <Route
          path="/calendar"
          element={
            <ProtectedRoute>
              <CalendarView token={token} projectId={1} />
            </ProtectedRoute>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
